import React from 'react';
import group from '../photos/group.jpg'
import styled from 'styled-components'
import { FaHeart, FaGlobeEurope, FaRocketchat } from "react-icons/fa";


const Div = styled.div`
margin-top: 100px;
padding-top: 60px;
width:100vw;
height:100vh;
background-color: #f12711;
background-image: url(${group});
background-position:center;
background-repeat:no-repeat;
background-size:cover;
background-attachment: fixed;
background-blend-mode: multiply;
@media (max-width: 768px) {
    height:150vh;
  }
`

const H1 = styled.h1`
color: #fefe;
text-align:center;
font-size: 25px;
font-weight:100;
`

const H2 = styled.h2`
color: #454545;
font-weight:100;
padding:15px;
`
const H3 = styled.h3`
color: #5e5e5e;
padding:15px;
`

const Wrapper = styled.div`
background: rgb(247, 247, 247);
text-align:center;
padding:20px;
margin-top: 180px;
color: #3d3d3d;
@media (max-width: 768px) {
    margin-top: 20px;
  }
`

const Item = styled.div`
    box-sizing:border-box;
    display:inline-block;
    margin:30px;
    width:30%;
    @media (max-width: 768px) {
    width: 80%;
    font-size:10px;
    color:#5e5e5e;
  }
`


function Advantages() {
    return (
        <Div >
            <H1>Genom oss har 42 000 människor hittat sin perfekta partner.
                Försök, det är gratis att gå med.</H1>
            <Wrapper>
                <Item>
                    <FaHeart size={70} />
                    <H2>Mer passion i ditt liv</H2>
                    <H3>Vi blir alla uttråkade nu och då; vi behöver nya utmaningar som hjälper oss att bryta oss loss från våra vanliga rutiner.</H3>
                </Item>
                <Item>
                    <FaGlobeEurope size={70} />
                    <H2>Anonymt flirtande</H2>
                    <H3>De flesta gillar i igenkänd på en hemsida kan vara ett stort steg. På detta sätt kan du börja med en trygg känsla!</H3>
                </Item>
                <Item>
                    <FaRocketchat size={70} />
                    <H2>Hur du kommer igång!</H2>
                    <H3>Skapa din profil på mindre än en minut! Med en profil kan du kommunicera med andra medlemmar.</H3>
                </Item>
            </Wrapper>
        </Div>
    );
}

export default Advantages;
